import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Transition } from "arclight-react";

const Constraints = styled.div`
  position: relative;
  padding-top: 142.25%;
  width: 100%;
  overflow: hidden;
  font-size: 2.5vw;
`;

const Card = styled.div`
  & img {
    opacity: 1;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
  }
`;

const Sub = styled.div`
  & img {
    height: 98%;
    -webkit-mask-image: -webkit-gradient(
      linear,
      left top,
      left bottom,
      from(rgba(0, 0, 0, 1)),
      to(rgba(0, 0, 0, 0))
    );
    mask-image: linear-gradient(to bottom, rgba(0, 0, 0, 1), rgba(0, 0, 0, 0));
  }
`;

const Text = styled.div`
  position: absolute;
  bottom: 20px;
  right: 20px;
  font-weight: bold;
  font-style: italic;
  color: white;
  background-color: "red;";
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Transition>
          <Constraints>
            <Card>
              <Sub>
                <img src={require("./img/yone.jpg")} />
              </Sub>
              <img src={require("../../../config/assets/border.png")} />
            </Card>
            <Text>Yone</Text>
          </Constraints>
        </Transition>
      </ThemeProvider>
    );
  }
}
